import React from "react";
import { Link } from "react-router-dom";

const ListProductCategory = (props) => {
  const changeRouter = (productCategory, id) => {
    productCategory = productCategory.replace(/ /gi, "-");
    props.history.replace("/category/" + id + "&" + productCategory);
    console.log("cek produk", props.category_name);
  };
  return (
    <div>
      <Link onClick={() => changeRouter(`${(props.category_name, props.id)}`)}>
        <div class="card category-card" style={{ width: "15rem" }}>
          <p className="card-img-top">{props.category_name}</p>
          <img
            src={require("../assets/rosehip.jpg")}
            class="card-img-top"
            alt=""
          />
        </div>
        {/* </div> */}
      </Link>
    </div>
  );
};

export default ListProductCategory;
